  true,\n\t\"url\": null,\n\t\"notes\": \"FedBizOpps is the single government point-of-entry
  for solicitations of any dollar amount and for required synopsis over $25,000, allowing
  commercial business suppliers and government buyers to post, search, monitor, and
  retrieve opportunities in federal government markets.  FBO now includes the functionality
  of the Federal Technical Data Solutions (FedTeDS) which allows agencies to securely
  disseminate sensitive acquisition-related technical data for solicitations to approved
  business partners. This dataset contains current active notices and is updated weekly.\",\n\t\"license_title\":
